import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  blog:{
    display:'flex',
    marginTop:105
  },
  img:{
    marginRight:'100px !important'
  },
  text:{
    width:"100%",
    alignSelf:'end'
  }
})
